import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Tenants from './components/Tenants';
import RentPayments from './components/RentPayments';

function App() {
    return (
        <Router>
            <div>
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Tenants</Link>
                        </li>
                        <li>
                            <Link to="/rent-payments">Rent Payments</Link>
                        </li>
                    </ul>
                </nav>

                <Switch>
                    <Route path="/" exact component={Tenants} />
                    <Route path="/rent-payments" component={RentPayments} />
                </Switch>
            </div>
        </Router>
    );
}

export default App;
